import { useSelector } from "react-redux";
import Card from "../Card/Card";

 const Favourites= ()=>{

    const myFavourites = useSelector((state)=>state.myFavourites);

    // name: name,
    //   species: species,
    //   gender: gender,
    //   origi: origin.name,
    //   id: id,
    //   image: image,


    return(
        <div>
            {myFavourites?.map((fav)=>(
                <Card 
                key= {fav.id}
                id= {fav.id}
                name= {fav.name}
                status= {fav.status}
                species= {fav.species}
                gender= {fav.gender}
                origin= {fav.origin?.name}
                image= {fav.image}
                onClose= {fav.onClose} />
            ))}
        </div>
    )
}


export default Favourites;
